const position = [2, 2.75, -1]
const rotation = [0, -1.75, 0]
const bg = '#FFAE00'
const blend = 'Combine'

let clicked = false

feature.on('click', () => {
  const sign = parcel.getFeatureById('pineapple-garden-sign')

  if (sign) {
    parcel.removeFeature(sign)
  }

  clicked = true

  const newSign = parcel.createFeature('sign')
  newSign.set({scale:[2.7, 0.3, 0.5]})
  newSign.set({position:position})
  newSign.set({rotation:rotation})
  newSign.set({background:bg})
  newSign.set({blendMode:blend})
  newSign.set({text:'Click the tokens to link out to a Rinkeby faucet'})
  setTimeout(() => {
    parcel.removeFeature(newSign)
    clicked = false  
  }, 3000)
})

feature.on('trigger', () => {
  const _sign = parcel.createFeature('sign')
    _sign.set({id: 'pineapple-garden-sign'})
    _sign.set({scale:[0.7, 0.3, 0.5]})
    _sign.set({position:position})
    _sign.set({rotation:rotation})
    _sign.set({background:bg})    
    _sign.set({blendMode:blend})  
    _sign.set({'text': 'click me'})  

    if (!clicked) {
    setTimeout(() => {
      parcel.removeFeature(_sign)
    }, 5000)
  }

})

